window.bookSummaryJSON = "<p><b>Without Jump Gate Omega, the Terran Commonwealth may not survive.</b></p> <p>Tyler shook his head. “Specify, Dad. What do you want us to do?”&nbsp;</p> <p>His father glared at him. “Go to the Rim, sue those amphibious bastards for everything they’ve got, and get Jump Gate Omega on track again!”</p> <p>If the new Matthews Corporation Jump Gate fails to span 2.5 million light years to the Andromeda galaxy, the heavily invested star-faring civilization of the Milky Way will face economic ruin and brutal war. The Star Lawyers must run a gauntlet to the Rim, dodging pirates, politicians, prelates, and predatory star nations intent on seizing the new Gate to Andromeda.</p> <p>Rollicking sci-fi fun, packed with humor, romance, and deep space adventure, punctuated with courtroom battles on alien worlds. Fans have dubbed the Star Lawyers series “<i>Star Trek</i> meets <i>Law &amp; Order</i>”.</p>"; 
